/*Table structure for table `coupon` */

DROP TABLE IF EXISTS `coupon`;

CREATE TABLE `coupon` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `product_id` bigint(20) NOT NULL COMMENT '商品编号',
  `coupon_price` decimal(10,0) NOT NULL COMMENT '券后价',
  `coupon_link` varchar(200) NOT NULL COMMENT '券链接',
  `type` tinyint(4) NOT NULL COMMENT '类型',
  `status` tinyint(4) NOT NULL COMMENT '状态',
  `created` datetime NOT NULL COMMENT '创建时间',
  `modified` datetime NOT NULL COMMENT '修改时间',
  `discount` decimal(10,0) NOT NULL COMMENT '券面额',
  `quota` decimal(10,0) NOT NULL COMMENT '券消费限额',
  `platform` varchar(100) NOT NULL COMMENT '券使用平台',
  `num` int(11) NOT NULL COMMENT '券总张数',
  `remainNum` int(11) NOT NULL COMMENT '券剩余张数',
  `yn` tinyint(4) NOT NULL COMMENT '券状态',
  `beginTime` datetime NOT NULL COMMENT '券有效使用开始时间',
  `endTime` datetime NOT NULL COMMENT '券有效使用结束时间',
  `takeBeginTime` datetime NOT NULL COMMENT '券领取开始时间',
  `takeEndTime` datetime NOT NULL COMMENT '券领取结束时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `coupon` */

/*Table structure for table `extract_detail` */

DROP TABLE IF EXISTS `extract_detail`;

CREATE TABLE `extract_detail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `open_id` varchar(200) NOT NULL COMMENT '微信openId',
  `extract_date` datetime NOT NULL COMMENT '提现时间',
  `extract_price` decimal(10,0) NOT NULL COMMENT '提现金额',
  `status` tinyint(4) NOT NULL COMMENT '结算状态',
  `created` datetime NOT NULL COMMENT '创建时间',
  `modified` datetime NOT NULL COMMENT '修改时间',
  `source_platform` int(11) NOT NULL COMMENT '商品来源商城（京东、淘宝、蘑菇街等）',
  `union_id` varchar(100) NOT NULL COMMENT '联盟子ID',
  `sub_union_id` varchar(100) NOT NULL COMMENT '联盟子ID',
  `platform_rate` decimal(10,0) NOT NULL COMMENT '平台抽成比例(轻松返抽成)',
  `user_commission` decimal(10,0) NOT NULL COMMENT '用户返还佣金',
  `ad_id` varchar(100) NOT NULL COMMENT '推广位ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `extract_detail` */

/*Table structure for table `order_summary` */

DROP TABLE IF EXISTS `order_summary`;

CREATE TABLE `order_summary` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `open_id` varbinary(200) NOT NULL COMMENT '微信openId',
  `summary_date` datetime NOT NULL COMMENT '统计日期',
  `click_count` int(11) NOT NULL COMMENT '点击数',
  `active_order_count` int(11) NOT NULL COMMENT '有效订单数量',
  `active_order_price` decimal(10,0) NOT NULL COMMENT '有效订单金额',
  `estimated _income` decimal(10,0) NOT NULL COMMENT '预估收入',
  `order_source` int(11) NOT NULL COMMENT '下单来源',
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `order_summary` */

/*Table structure for table `product` */

DROP TABLE IF EXISTS `product`;

CREATE TABLE `product` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(200) NOT NULL,
  `product_id` bigint(20) NOT NULL,
  `first_category` int(11) NOT NULL,
  `first_category_name` varchar(200) NOT NULL,
  `second_category` int(11) NOT NULL,
  `second_category_name` varchar(200) NOT NULL,
  `third_category` int(11) NOT NULL,
  `third_category_name` varchar(200) NOT NULL,
  `original_price` double NOT NULL COMMENT '原价',
  `stock` int(11) NOT NULL COMMENT '库存',
  `commission_ratio_pc` double NOT NULL COMMENT 'PC佣金比例',
  `commission_ratio_wl` double NOT NULL COMMENT '移动佣金比例',
  `product_type` int(11) NOT NULL,
  `distribution` int(11) NOT NULL COMMENT '配送方式',
  `status` tinyint(4) NOT NULL,
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  `img_url` varchar(200) NOT NULL COMMENT '图片地址',
  `sort_weight` int(11) NOT NULL COMMENT '排序',
  `is_rebate` tinyint(4) NOT NULL,
  `unitPrice` decimal(10,0) NOT NULL COMMENT '单价',
  `wlUnitPrice` decimal(10,0) NOT NULL COMMENT '无线价',
  `source_platform` int(11) NOT NULL COMMENT '商品来源商城（京东、淘宝、蘑菇街等）',
  `materialUrl` varchar(200) NOT NULL COMMENT '落地页',
  `startDate` datetime NOT NULL COMMENT '开始推广日期',
  `endDate` datetime NOT NULL COMMENT '结束推广日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=968 DEFAULT CHARSET=utf8;

